SELECT * FROM (SELECT *, DENSE_RANK() OVER (ORDER BY bpa_lastModifiedTime DESC) offset_ FROM (SELECT bpa.*,bpadoc.*,bpa.id as bpa_id,bpa.tenantid as bpa_tenantId,bpa.lastModifiedTime as bpa_lastModifiedTime,bpa.createdBy as bpa_createdBy,bpa.lastModifiedBy as bpa_lastModifiedBy,bpa.createdTime as bpa_createdTime,bpa.additionalDetails,bpa.reworkhistory as reWorkHistory,bpa.isRevisionApplication as bpa_isRevisionApplication,bpa.landId as bpa_landId, bpadoc.id as bpa_doc_id, bpadoc.additionalDetails as doc_details, bpadoc.documenttype as bpa_doc_documenttype,bpadoc.filestoreid as bpa_doc_filestore,bpadsc.id as dsc_id,bpadsc.additionaldetails as dsc_additionaldetails,bpadsc.documenttype as dsc_doctype,bpadsc.documentid as dsc_docid,bpadsc.approvedby as dsc_approvedby,bpadsc.applicationno as dsc_applicationno,bpadsc.buildingplanid as dsc_buildingplanid,bpadsc.createdBy as dsc_createdby,bpadsc.lastmodifiedby as dsc_lastmodifiedby,bpadsc.createdtime as dsc_createdtime,bpadsc.lastmodifiedtime as dsc_lastmodifiedtime  FROM eg_bpa_buildingplan bpa LEFT OUTER JOIN eg_bpa_dscdetails bpadsc ON bpadsc.buildingplanid = bpa.id LEFT OUTER JOIN eg_bpa_document bpadoc ON bpadoc.buildingplanid = bpa.id WHERE  bpa.tenantid like '%od%' AND bpa.createdby IN ( '695eeefa-ffb0-4d43-944d-7dc260e213f7')) result) result_offset